// 这是一个示例脚本
// 定义一个处理函数，接收消息数据作为参数
function process(messageData) {
  // 获取消息命令
  const cmd = messageData.cmd;

  // 根据不同的命令执行不同的操作
  if (cmd === '某个特定命令') {
    // 处理特定命令的逻辑
    log('收到特定命2令: ' + cmd);

    // 可以访问消息的所有字段
    if (messageData.data && messageData.data.someField) {
      notify('发现特定字段: ' + messageData.data.someField, 'success');
    }

    // 返回处理结果（可选）
    return '处理完成';
  }

  // 可以处理所有类型的消息
  notify('收到消息3333: ' + cmd);
}
